import React from 'react';
import logo from './logo.svg';
import './App.css';
import Nav from './Nav.js';
import Main from './Main.js';

import {
  BrowserRouter as Router,
} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
	<Main />
      </div>
    </Router>
  );
}

export default App;
